●車内のパネルや内張りの合わせ目に沿わして、ジャマなケーブルをキレイに配線できるケーブルフックモールです。<br>●特殊な差込形状で内張りの隙間に差し込むだけでカンタンに取り付けができます。<br>●ケーブルの太さは、丸型（φ5mm）、平型（幅7mm×高さ5mm）まで対応しています。この範囲内であれば複数入れくことも出来ます。<br>●短くカットしてポイントフックとしてもご使用になれます。<br>●付属の両面テープを使用して、しっかりと固定することができます。<br><br>品番：W873<br>メーカー：セイワSEIWA<style type="text/css">
